webpackJsonp([0xb8e4a92f40f1],{776:function(t,e){t.exports={data:{wordpressPost:{title:"Beauty Editor Kelly Baker Shares Her Fave Travel Must-Haves",content:'<p>There&#8217;s nothing I like more than a quick getaway and so I make sure I cram one in whenever the opportunity arises. Given that I know EXACTLY what I need to pack in my beauty bag. Because a trip away is ace &#8211; but a beauty emergency is not. Here, the items I never travel without.</p>\n<img class="size-medium wp-image-2351 aligncenter" src="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/06/17220543/BB-JPG-240x300.jpg" alt="" width="240" height="300" srcset="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/06/17220543/BB-JPG-240x300.jpg 240w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/06/17220543/BB-JPG.jpg 314w" sizes="(max-width: 240px) 100vw, 240px" />\n<p><a href="http://www.bobbibrown.com.au/product/2342/47375/makeup/lips/lip-color/art-stick-liquid-lip/ss17">Bobbi Brown Havana Brights Art Stick Liquid Lip, $46.</a></p>\n<p>This sweet-as lip colour lasts all day and provides an awesome semi-matte finish. The creamy formula offers full coverage in a squeezable stick so it&#8217;s plane, train and automobile safe. I&#8217;m mad about Pink Punch.</p>\n<img class="size-medium wp-image-2264 aligncenter" src="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/05/31222709/Eve-L-JPG-297x300.jpg" alt="" width="297" height="300" srcset="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/05/31222709/Eve-L-JPG-297x300.jpg 297w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/05/31222709/Eve-L-JPG-768x776.jpg 768w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/05/31222709/Eve-L-JPG.jpg 915w" sizes="(max-width: 297px) 100vw, 297px" />\n<p><a href="http://www.mecca.com.au/eve-lom/brightening-mask/I-023739.html#q=Eve%2BLom%2Bbrightening%2Bmask&amp;start=1">Eve Lom Brightening Mask, $227.</a></p>\n<p>It&#8217;s a bit indulgent forking out this amount of cash for just eight masks, but I swear to you they&#8217;re amazing. Each sheet is infused with powerful ingredients that ease pigmentation, provide intense moisture and a killer glow.<img class="size-medium wp-image-2352 aligncenter" src="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/06/17223124/Funaya-Onsen-Travel-Candle-300x300.jpg" alt="" width="300" height="300" srcset="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/06/17223124/Funaya-Onsen-Travel-Candle-300x300.jpg 300w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/06/17223124/Funaya-Onsen-Travel-Candle-150x150.jpg 150w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/06/17223124/Funaya-Onsen-Travel-Candle-768x768.jpg 768w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/06/17223124/Funaya-Onsen-Travel-Candle.jpg 900w" sizes="(max-width: 300px) 100vw, 300px" /></p>\n<p><a href="https://apsulife.com/product/onsen-travel-candle/">Apsu Onsen Travel Candle, $19.</a></p>\n<p>I find it difficult to sleep at the best of times so hotels are a challenge. A candle always helps &#8211; this one in particular. It&#8217;s a gorgeous blend of cedar wood, sandalwood and patchouli with a touch of Japanese cypress plus lemon, bergamot and Aussie eucalyptus. Heaven.<img class="size-medium wp-image-2354 aligncenter" src="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/06/17223801/lano-JPG-120x300.jpg" alt="" width="120" height="300" srcset="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/06/17223801/lano-JPG-120x300.jpg 120w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/06/17223801/lano-JPG.jpg 277w" sizes="(max-width: 120px) 100vw, 120px" /></p>\n<p><a href="https://www.priceline.com.au/brand/lanolips/lanolips-lanolips-tinted-balm-spf-30-rose-12-5-g">Lanolips Tinted Balm SPF 30 Rose, $14.99.</a></p>\n<p>Travelling kills my lips. Hotel air-con is drying and planes are even worse. I fight back by keeping a handy tube of cult beauty buy Lanolips with me at all times. This rose version is my favourite and I wear it all day and then, keep it by my bedside at night just in case.<img class="size-medium wp-image-2355 aligncenter" src="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/06/17224554/Stila-palette-JPG-300x274.jpg" alt="" width="300" height="274" srcset="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/06/17224554/Stila-palette-JPG-300x274.jpg 300w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/06/17224554/Stila-palette-JPG-768x702.jpg 768w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/06/17224554/Stila-palette-JPG.jpg 904w" sizes="(max-width: 300px) 100vw, 300px" /></p>\n<p>&nbsp;</p>\n<p><a href="http://www.mecca.com.au/stila/correct-and-perfect-palette/I-023837.html?cgpath=makeup-palettessets#start=1">Stila Correct and Perfect Palette, $66.</a></p>\n<p>This clever clogs palette can give you the skin of your dreams and in five minutes flat. With its five shades it can camouflage every skin problem anyone has ever faced and leave you looking truly luminous even if you&#8217;ve travelled for days and slept not one wink.<img class="size-medium wp-image-2356 aligncenter" src="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/06/17225007/55ML-RELAX-DEEP-BS-OIL-BOX-220x300.jpg" alt="" width="220" height="300" srcset="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/06/17225007/55ML-RELAX-DEEP-BS-OIL-BOX-220x300.jpg 220w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/06/17225007/55ML-RELAX-DEEP-BS-OIL-BOX-768x1046.jpg 768w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/06/17225007/55ML-RELAX-DEEP-BS-OIL-BOX-752x1024.jpg 752w" sizes="(max-width: 220px) 100vw, 220px" /></p>\n<p><a href="http://www.aromatherapyassociates.com.au/bath-and-body/collections/relax/deep-relax-bath-and-shower-oil.html">Aromatherapy Associates Deep Relax Bath &amp; Shower Oil, $92.</a></p>\n<p>My holiday hasn&#8217;t officially kicked off until I&#8217;ve spent a lengthy amount of time in a steaming hot bath. I make it extra special by adding a capful of this seriously relaxing oil. In the morning I lather it over my body before stepping into the shower. So good.<img class="size-medium wp-image-2357 aligncenter" src="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/06/17225400/16965-Anthe-%C2%AAlios-XL-creme-50-BB-bd.jpg" alt="" width="225" height="300" srcset="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/06/17225400/16965-Anthe-%C2%AAlios-XL-creme-50-BB-bd.jpg 3937w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/06/17225400/16965-Anthe-%C2%AAlios-XL-creme-50-BB-bd-225x300.jpg 225w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/06/17225400/16965-Anthe-%C2%AAlios-XL-creme-50-BB-bd-768x1024.jpg 768w" sizes="(max-width: 225px) 100vw, 225px" /></p>\n<p><a href="https://www.priceline.com.au/brand/la-roche-posay/la-roche-posay-anthelios-tinted-bb-comfort-cream-spf50-50-ml">La Roche-Posay Anthelios XL Comfort Cream SPF 50+, $28.95.</a></p>\n<p>A lightly tinted that provides a pretty, subtle luminosity and the best sun protection on the market. It&#8217;s not greasy (hurrah), is great for sensitive skins and has a fresh, sporty scent. A winner.</p>\n<img class="size-medium wp-image-2360 aligncenter" src="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/06/17231205/fudge_lightheaded_bottle-bd-123x300.jpg" alt="" width="123" height="300" srcset="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/06/17231205/fudge_lightheaded_bottle-bd-123x300.jpg 123w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/06/17231205/fudge_lightheaded_bottle-bd-768x1876.jpg 768w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/06/17231205/fudge_lightheaded_bottle-bd-419x1024.jpg 419w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/06/17231205/fudge_lightheaded_bottle-bd.jpg 1433w" sizes="(max-width: 123px) 100vw, 123px" />\n<p><a href="http://www.ry.com.au/fudge-light-hed-ed-hair-oil-50ml.html">Fudge Light HED-ed Hair Oil, $19.05.</a></p>\n<p>This light-weight oil is perfect for my frizzy-fly-away hair. It&#8217;s not the least bit greasy, smells delicious and provides gorgeous shine leaving locks soft and smooth. Quite something.</p>\n',better_featured_image:{source_url:"http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/06/17215400/Hair-Kelly-JPG.jpg"},categories:[{slug:"lifestyle",name:"Lifestyle"}]},site:{siteMetadata:{title:"The Beauty Insider"}}},pathContext:{id:"7321c51c-b831-5e44-9185-17df968699e9"}}}});
